import React from "react";

function Note(props) {
  function handleClick() {
    props.onDelete(props.id);
  }
  function handleEdit() {
    props.onEdit(props.id, props.title, props.content, props.author);
  }
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <p>{props.author}</p>

      <button onClick={handleClick}>DELETE</button>
      <button onClick={handleEdit}> EDIT</button>
    </div>
  );
}

export default Note;
